"use strict";

function f_gold(N) {
    let op = 0;
    let s = [N];
    for (let i = N - 1; i > 0; i--) {
        if (op === 0) {
            s.push(s.pop() * i);
        } else if (op === 1) {
            s.push(parseInt(s.pop() / i));
        } else if (op === 2) {
            s.push(i);
        } else {
            s.push(-i);
        }
        op = (op + 1) % 4;
    }
    return s.reduce((a, b) => a + b, 0);
}
